Update field in mongoDB with it's substring<p>I would like to shorten all long descriptions in my object. 
I have searched and read many articles but I can't figure out how to do this simple task in mongoDB.
What I am trying to achieve would be simple in SQL:</p>

<pre><code>UPDATE AssetDocument SET description = substr(description, 0, 500) WHERE length(description) &gt; 500
</code></pre>

<p>Can please someone help me do this in MongoDB?</p>

<p>I have tried this:</p>

<pre><code>db.AssetDocument.updateMany(
{$where: "this.metadata.description.length &gt; 500"},
{$set: { "metadata.description": { $substr: ["metadata.description", 0, 500]}}});
</code></pre>

<p>This gives me errmsg: <code>The dollar ($) prefixed field '$substr' in 'metadata.description.$substr' is not valid for storage.</code></p>

<p>Then I tried this: </p>

<pre><code>db.AssetDocument.find({
  $where: "this.metadata.description.length &gt; 500"
}).forEach(function(e){
  e.metadata.description = {$substr: [e.metadata.description, 0, 500]};
  db.AssetDocument.save(e);
});
</code></pre>

<p>But this doesn't work... </p>

